using CreatureBracket.DTOs.Responses;
using CreatureBracket.Exceptions;
using CreatureBracket.Misc;
using CreatureBracket.Models;
using Microsoft.EntityFrameworkCore;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;

namespace CreatureBracket.Repositories
{
    public class BracketRepository : ModelRepository<Bracket>
    {
        public BracketRepository(DatabaseContext context) : base(context) { }

        public override async Task PostAsync(Bracket entity)
        {
            if (await _context.Brackets.AnyAsync(x => x.Status != Bracket.EStatus.Completed))
            {
                throw new ExpectedException("You can only have one active bracket at a time!");
            }

            await base.PostAsync(entity);
        }

        public async Task<Bracket> ActiveAsync()
        {
            if (!await _context.Brackets.AnyAsync())
            {
                return null;
            }

            var activeBracket = await _context.Brackets.SingleOrDefaultAsync(x => x.Status != Bracket.EStatus.Completed);

            if (activeBracket is null)
            {
                activeBracket = await _context.Brackets.OrderByDescending(x => x.CompletedDateTime).Take(1).SingleOrDefaultAsync();
            }

            return activeBracket;
        }

        public async Task<ActiveBracketStatusResponseDTO> ActiveStatusAsync()
        {
            var activeBracket = await ActiveAsync();

            if (activeBracket is null)
            {
                return null;
            }

            var activeBracketDTO = new ActiveBracketStatusResponseDTO
            {
                Status = activeBracket.Status
            };

            return activeBracketDTO;
        }

        public async Task CompleteActive()
        {
            var activeBracket = await ActiveAsync();

            if (activeBracket is null || activeBracket.Status == Bracket.EStatus.Completed)
            {
                return;
            }

            activeBracket.Status = Bracket.EStatus.Completed;
            activeBracket.CompletedDateTime = DateTime.UtcNow;
        }

        public async Task<CanEditMyBracketDTO> CanEditMyBracketAsync()
        {
            var activeBracket = await ActiveAsync();

            var response = new CanEditMyBracketDTO
            {
                CanEdit = activeBracket.BracketSubmissionDeadline > DateTime.UtcNow
            };

            return response;
        }

        public async Task<List<StandingsItemDTO>> StandingsAsync()
        {
            if (!await _context.Brackets.AnyAsync())
            {
                return null;
            }

            var activeBracket = await ActiveAsync();

            var standings = new List<StandingsItemDTO>();

            var userBrackets = await _context.UserBrackets.OrderByDescending(x => x.Points)
                                                            .ThenBy(x => x.UserName)
                                                          .Where(x => x.BracketId == activeBracket.Id)
                                                          .ToListAsync();

            foreach (var userBracket in userBrackets)
            {
                var adUserInfo = ADUserInfo.GetByUserName(userBracket.UserName);

                var tiedItems = standings.Where(x => x.Points == userBracket.Points).ToList();

                var standingItem = new StandingsItemDTO
                {
                    FirstName = adUserInfo.FirstName,
                    LastName = adUserInfo.LastName,
                    Points = userBracket.Points,
                    Rank = tiedItems.Any() ? tiedItems[0].Rank : userBrackets.IndexOf(userBracket) + 1,
                    Image = null,
                    UserName = userBracket.UserName
                };

                standings.Add(standingItem);
            }

            return standings;
        }

        public async Task<List<SeedMatchupDTO>> GetCurrentSeedStandings()
        {
            var active = await ActiveAsync();

            var creatures = await _context.Creatures.Where(x => x.BracketId == active.Id).ToListAsync();

            var currentProjectedMatchups = GetSeededCreatures(creatures);

            return currentProjectedMatchups;
        }

        public async Task<List<SeedMatchupDTO>> SeedCreaturesAsync()
        {
            var active = await ActiveAsync();

            var creatures = await _context.Creatures.Where(x => x.BracketId == active.Id).ToListAsync();

            if (creatures.Count != 16)
            {
                throw new ExpectedException("There are not 16 creatures approved for the tournament!");
            }

            creatures.Randomize();

            for (int ix = 0; ix < creatures.Count; ix++)
            {
                creatures[ix].Seed = ix;
            }

            var currentProjectedMatchups = GetSeededCreatures(creatures);

            return currentProjectedMatchups;
        }

        private List<SeedMatchupDTO> GetSeededCreatures(List<Creature> creatures)
        {
            var currentProjectedMatchups = new List<SeedMatchupDTO>();
            int creatureCounter = 0;

            for (int i = 0; i < creatures.Count / 2; i++)
            {
                var matchup = new SeedMatchupDTO
                {
                    MatchupSeed = i,
                    Contestants = new List<CreatureSeedDTO>
                    {
                        new CreatureSeedDTO
                        {
                            Name = creatures[creatureCounter].Name,
                            BIO = creatures[creatureCounter].BIO,
                            Image = creatures[creatureCounter].Image,

                        },
                        new CreatureSeedDTO
                        {
                            Name = creatures[creatureCounter + 1].Name,
                            BIO = creatures[creatureCounter + 1].BIO,
                            Image = creatures[creatureCounter + 1].Image,
                        }
                    }
                };
                creatureCounter += 2;
                currentProjectedMatchups.Add(matchup);
            }

            return currentProjectedMatchups;
        }

        public async Task StartAsync()
        {
            var active = await ActiveAsync();
            active.Status = Bracket.EStatus.Started;
            active.BracketSubmissionDeadline = DateTime.UtcNow.Date.AddHours(12).AddDays(7);

            await CreateNewRoundAsync();
        }

        public async Task CreateNewRoundAsync(Round lastRound = null)
        {
            var active = await ActiveAsync();

            var creatures = await _context.Creatures.Where(x => x.BracketId == active.Id).ToListAsync();

            var rank = lastRound is null ? 1 : lastRound.Rank + 1;
            var creatureCount = lastRound is null ? 16 : lastRound.CreatureCount / 2;
            //64
            var matchupCount = creatureCount / 2;

            var round = new Round
            {
                Id = Guid.NewGuid(),
                BracketId = active.Id,
                Rank = rank,
                CreatureCount = creatureCount,
                VoteDeadline = lastRound is null ? DateTime.UtcNow.Date.AddHours(12).AddDays(7) : DateTime.UtcNow.Date.AddHours(12).AddDays(3),//I want the battles to execute at 12 pm server time
                EmailReminderSent = false
            };

            var matchups = new List<Matchup>();

            for (int ix = 0; ix < matchupCount; ix++)
            {
                var creature1 = lastRound is null ?
                                    creatures.Single(x => x.Seed == ix * 2) :
                                    lastRound.Matchups[ix * 2].Winner;
                var creature2 = lastRound is null ?
                                    creatures.Single(x => x.Seed == (ix * 2) + 1) :
                                    lastRound.Matchups[(ix * 2) + 1].Winner;

                var matchup = new Matchup
                {
                    Id = Guid.NewGuid(),
                    Creature1Id = creature1.Id,
                    Creature2Id = creature2.Id,
                    RoundId = round.Id,
                    LoserId = null,
                    WinnerId = null,
                    SystemDateTime = DateTime.UtcNow
                };

                matchups.Add(matchup);
            }

            _context.Rounds.Add(round);
            _context.Matchups.AddRange(matchups);
        }

        public async Task<BracketResponseDTO> GlobalAsync(string userName)
        {
            var active = await ActiveAsync();

            var rounds = await _context.Rounds.Include(x => x.Matchups)
                                                .ThenInclude(x => x.Creature1)
                                              .Include(x => x.Matchups)
                                                .ThenInclude(x => x.Creature2)
                                              .Include(x => x.Matchups)
                                                .ThenInclude(x => x.Votes)
                                              .Where(x => x.BracketId == active.Id).ToListAsync();

            var round1 = rounds.SingleOrDefault(x => x.Rank == 1);
            var round1Tuple = RoundToDTO(round1, userName);
            var round1DTO = round1Tuple.Item1;

            var round2 = rounds.SingleOrDefault(x => x.Rank == 2);
            var round2Tuple = RoundToDTO(round2, userName, round1Tuple.Item2);
            var round2DTO = round2Tuple.Item1;

            var round3 = rounds.SingleOrDefault(x => x.Rank == 3);
            var round3Tuple = RoundToDTO(round3, userName, round2Tuple.Item2);
            var round3DTO = round3Tuple.Item1;

            var round4 = rounds.SingleOrDefault(x => x.Rank == 4);
            var round4Tuple = RoundToDTO(round4, userName, round3Tuple.Item2);
            var round4DTO = round4Tuple.Item1;

            //var round5 = rounds.SingleOrDefault(x => x.Rank == 5);
            //var round5Tuple = RoundToDTO(round5, userName, round4Tuple.Item2);
            //var round5DTO = round5Tuple.Item1;

            //var round6 = rounds.SingleOrDefault(x => x.Rank == 6);
            //var round6Tuple = RoundToDTO(round6, userName, round5Tuple.Item2);
            //var round6DTO = round6Tuple.Item1;

            var result = new BracketResponseDTO
            {
                Rounds = new List<RoundResponseDTO>
                {
                    round1DTO,
                    round2DTO,
                    round3DTO,
                    round4DTO,
                    //round5DTO,
                    //round6DTO
                }
            };

            return result;
        }

        private Tuple<RoundResponseDTO, int> RoundToDTO(Round round, string userName, int? lastRoundCreatureCount = null)
        {
            var roundDTO = new RoundResponseDTO
            {
                Matchups = new List<MatchupResponseDTO>(),
                Rank = 1
            };

            if (round != null)
            {
                roundDTO.Rank = round.Rank;

                var matchups = round.Matchups.OrderBy(x => x.SystemDateTime).ToList();

                foreach (var matchup in matchups)
                {
                    var vote = matchup.Votes.SingleOrDefault(x => x.UserName == userName);

                    var matchupDTO = new MatchupResponseDTO
                    {
                        Current = round.VoteDeadline > DateTime.UtcNow && matchup.Winner != null,
                        MatchupId = matchup.Id,
                        Contestants = new List<CreatureResponseDTO>
                        {
                            new CreatureResponseDTO
                            {
                                CreatureId = matchup.Creature1Id,
                                BIO = matchup.Creature1.BIO,
                                Image = null,
                                Name = matchup.Creature1.Name,
                                Winner = matchup.WinnerId == matchup.Creature1Id
                            },
                            new CreatureResponseDTO
                            {
                                CreatureId = matchup.Creature2Id,
                                BIO = matchup.Creature2.BIO,
                                Image = null,
                                Name = matchup.Creature2.Name,
                                Winner = matchup.WinnerId == matchup.Creature2Id
                            }
                        },
                        Vote = vote is null ? null : new VoteResponseDTO
                        {
                            CreatureId = vote.CreatureId,
                            VoteId = vote.Id
                        },
                        RoundRank = round.Rank,
                        MatchupSeed = matchups.IndexOf(matchup) + 1
                    };

                    roundDTO.Matchups.Add(matchupDTO);
                }
            }
            else if (lastRoundCreatureCount.HasValue)
            {
                for (var ix = 0; ix < lastRoundCreatureCount / 4; ix++)
                {
                    var matchupDTO = new MatchupResponseDTO
                    {
                        Contestants = null,
                        Current = true,
                        MatchupSeed = ix + 1,
                        RoundRank = 1,
                        Unset = true,
                        Vote = null,
                    };

                    roundDTO.Matchups.Add(matchupDTO);
                }
            }
            else
            {
                throw new Exception("lastRoundCreatureCount must not be null if round is null! (BracketRepository.RoundToDTO())");
            }

            var creatureCount = round is null ? lastRoundCreatureCount.Value / 2 : round.CreatureCount;

            return Tuple.Create(roundDTO, creatureCount);
        }

